import {View, Text, Image, StyleSheet} from 'react-native'

const frogItem = props =>{
    var icon =require('../assets/icon.png');
    if(props.image){
        icon = '../assets/'+props.image
        console.log(icon)
    }
    return(
        <View style={styles.frogs}>
            <Image source={{ uri: icon  }} style={styles.frogImage} />        
            <Text>{props.name}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    frogs:{
        width: "100%",
        height: 200
    },
    frogImage:{
        width: 100,
        height: 100
    }
})

export default frogItem;
